import React from 'react';
const AboutUs = () => {
  return (
    <div>
      {" "}
      <h1>About Us</h1>
      <p>
        Hi/Tec Copy Center has been in operation since 1986. We take pride in
        producing the best quality work, on time at the most competitive prices.
        We have over 30 well-trained employees to provide friendly and fast
        service. Hi/Tec is centrally located at the corner of Big Bend and
        Forest Park Parkway, only minutes from downtown St. Louis and downtown
        Clayton. Our state-of-the-art equipment can meet all of your diverse
        copying, printing and finishing needs from self-serve copies to hundreds
        of thousands of black & white or color copies overnight.
      </p>
    </div>
  );
};

export default AboutUs;
